import React from 'react'
import { NavLink } from './components'


class Footer extends React.Component {
    render() {
        return (
            <div className="Footer">
                <div className="Footer-nav center">
                    <NavLink id="https://www.linkedin.com/in/mark-fioca/" target="_blank" rel="noopener noreferrer" title="LinkedIn" />
                    
                    <div>
                        <a href="https://www.deviantart.com/franknmullet" target="_blank" rel="noopener noreferrer">
                            Deviantart
                        </a>
                    </div>
                </div>
                <div className="email">
                    <div>
                        <a href="mailto: mark@fioca.com">
                            <a>Send Email</a>
                        </a>
                    </div>
                </div>
            </div>
        );
    }
}

export default Footer;
